import * as React from 'react';
import { Routes, Route, Link } from "react-router-dom";
import Home from './routes/Home'; 
import Votes from './routes/Votes';
import Pagestate from './routes/Pagestate';
import Reservation from './routes/Reservation';
import Forum from './routes/Forum';
import Packages from './routes/Packages';
import HomeSesion from './routes/HomeSesion';
import './assets/styles/custom.css'

export default function App() {
  return (
    <div style={{width: '1024px', margin: 'auto', marginTop: '20px'}}>
      <div className='row' style={{ float: "right", }}>
        <nav className='col-md-12 float-right'>
          <Link to="/Home">Home |</Link> 
          <Link to="/Pagestate">Page of state |</Link>
          <Link to="/Reservation">Reservation |</Link>
          <Link to="/Forum">Forum |</Link>
          <Link to="/Votes">Votes |</Link>
          <Link to="/Packages">Packages |</Link>
          <Link to="/HomeSesion">User</Link> 
        </nav>  
      </div>

      <Routes>
        {/* <Route path="Home" element={<Home />}/> */}
        <Route path="Pagestate" element={<Pagestate />} />
        <Route path="Reservation" element={<Reservation />} />
        <Route path="Forum" element={<Forum/>} />
        <Route path="Votes" element={<Votes/>} />
        <Route path="Packages" element={<Packages/>} />
        <Route path="HomeSesion" element={<HomeSesion />} />
      </Routes>
    </div>
  );
}
